import React from 'react';
import { getTeamLogoUrl } from '../utils/teamLogos';

export const TeamOption = ({ data, ...props }) => {
  return (
    <div className="team-option" {...props}>
      <img 
        src={getTeamLogoUrl(data.value)} 
        alt={`${data.label} logo`}
        className="team-logo"
        onError={(e) => {
          e.target.onerror = null;
          e.target.src = defaultLogoUrl;
        }}
      />
      <span>{data.label}</span>
    </div>
  );
};

export const TeamValue = ({ data, ...props }) => {
  return (
    <div className="team-value" {...props}>
      <img 
        src={getTeamLogoUrl(data.value)} 
        alt={`${data.label} logo`}
        className="team-logo-small"
        onError={(e) => {
          e.target.onerror = null;
          e.target.src = defaultLogoUrl;
        }}
      />
      <span>{data.label}</span>
    </div>
  );
};
